/* =============== 1) Customer =============== */
CREATE TABLE Customer (
    CustomerID      INT         NOT NULL,
    CustomerName    VARCHAR(100),
    CustomerCity    VARCHAR(100),
    CustomerRegion  VARCHAR(50),
    PRIMARY KEY (CustomerID)
);

-- INSERTS FOR Customers

/* =============== 2) Cars_Category =============== */
CREATE TABLE Cars_Category (
    MakeID       INT          NOT NULL,
    MakeName     VARCHAR(100),
    MakeCountry  VARCHAR(50),
    PRIMARY KEY (MakeID)
);

-- INSERTS FOR Cars_Category

/* =============== 3) Cars_Model =============== */
CREATE TABLE Cars_Model (
    ModelID      INT           NOT NULL,
    ModelName    VARCHAR(100),
    MakeID       INT           NOT NULL,
    PRIMARY KEY (ModelID),
    FOREIGN KEY (MakeID) REFERENCES Cars_Category(MakeID)
);

-- INSERTS FOR Cars_Model

/* =============== 4) Stock =============== */
CREATE TABLE Stock (
    StockID      VARCHAR(50)   NOT NULL,
    DateBought   DATETIME      NULL,
    ModelID      INT           NOT NULL,
    PRIMARY KEY (StockID),
    FOREIGN KEY (ModelID) REFERENCES Cars_Model(ModelID)
);
-- INSERTS FOR Stock

/* =============== 5) Sales =============== */
CREATE TABLE Sales (
    SalesID     INT         NOT NULL,
    SaleDate    DATETIME    NULL,
    CustomerID  INT         NOT NULL,
    PRIMARY KEY (SalesID),
    FOREIGN KEY (CustomerID) REFERENCES Customer(CustomerID)
);

-- INSERTS FOR Sales

/* =============== 6) SalesDetails =============== */
CREATE TABLE SalesDetails (
    SalesDetailsID     INT           NOT NULL,
    SalesID            INT           NOT NULL,
    LineItemNumber     INT           NULL,
    StockID            VARCHAR(50)   NOT NULL,
    SalePrice          DECIMAL(10,2) NULL,
    LineItemDiscount   DECIMAL(10,2) NULL,
    Total_Cost         DECIMAL(10,2) NULL,
    Total_Sales        DECIMAL(10,2) NULL,
    Profit             DECIMAL(10,2) NULL,
    Profit_Percentage  DECIMAL(5,4)  NULL,
    PRIMARY KEY (SalesDetailsID),
    FOREIGN KEY (SalesID) REFERENCES Sales(SalesID),
    FOREIGN KEY (StockID) REFERENCES Stock(StockID)
);
-- INSERTS FOR SalesDetails

select sum(Total_Sales) as " Total Sales " from SalesDetails

SELECT 
    YEAR(s.SaleDate) AS SaleYear,
    SUM(sd.Total_Sales) AS [Total Sales]
FROM SalesDetails sd
JOIN Sales s ON sd.SalesID = s.SalesID
GROUP BY YEAR(s.SaleDate)
ORDER BY SaleYear DESC;



select sum(Profit) as " Total Sales " from SalesDetails

SELECT TOP 5 
    c.CustomerID,
    c.CustomerName,
    SUM(sd.Total_Sales) AS TotalSales
FROM Customer c
JOIN Sales s ON c.CustomerID = s.CustomerID
JOIN SalesDetails sd ON s.SalesID = sd.SalesID
GROUP BY c.CustomerID, c.CustomerName
ORDER BY TotalSales DESC;

